import React, { useState } from "react";
import { Link } from "react-router-dom";
import pic from "../images/subscription.jpg";
import { useDispatch } from "react-redux";
import { PayPalScriptProvider } from "@paypal/react-paypal-js";
import "../screens/mediaqueries.css";
import PayPalButton from "../components/PaypalButton";

function Subscription() {
  const [selectedPlan, setSelectedPlan] = useState(null);
  const dispatch = useDispatch();

  return (
    <div
      style={{
        position: "fixed",
        height: "100vh",
        width: "100vw",
        overflow: "hidden",
      }}
      onClick={() => setSelectedPlan(null)}
    >
      <div
        className="container"
        style={{
          content: "",
          position: "fixed",
          width: "100%",
          height: "100%",
          backgroundImage: `url(${pic})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          zIndex: -1,
        }}
      />
      <div>
        <p
          style={{
            color: "#fc033d",
            position: "absolute",
            top: "-30vh",
            right: "5vh",
            textAlign: "justify",
            fontSize: "2.4vw",
            fontWeight: "bold",
          }}
        >
          <br />
          <br />
          <br />
          <br />
          <br />
          Choose your stated plan
        </p>
        <p
          style={{
            color: "#fce703",
            position: "absolute",
            top: "14vh",
            right: "5vh",
            textAlign: "right",
            fontSize: "1.4vw",
            fontWeight: "bold",
          }}
        >
          Ad free.
          <br />
          Change or cancel plans anytime.
        </p>
        <table
          style={{
            marginTop: "28vh",
            backgroundColor: "#1200b8",
            marginBottom: "1vh",
            color: "#ffffff",
            width: "1vw", // Set the width of the table
            height: "1vh", // Set the height of the table to auto for dynamic height
            marginLeft: "auto",
            marginRight: "auto",
          }}
        >
          <tbody style={{ position: "relative" }}>
            <tr>
              <td style={{ padding: "1vw", textAlign: "center" }}></td>{" "}
              {/* Reduced padding */}
              <td style={{ padding: "1vw", textAlign: "center" }}>
                <button
                  style={{
                    cursor: "pointer",
                    backgroundColor:
                      selectedPlan === "Standard" ? "#b700ff" : "#3700ff",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "3vw",
                    fontSize: "2vw",
                    padding: "1vw 2vw",
                    fontWeight: "bolder",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Standard");
                  }}
                >
                  Standard
                </button>
              </td>
              <td style={{ padding: "1vw", textAlign: "center" }}>
                <button
                  style={{
                    cursor: "pointer",
                    backgroundColor:
                      selectedPlan === "Premium" ? "#b700ff" : "#3700ff",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "3vw",
                    fontSize: "2vw",
                    padding: "1vw 2vw",
                    fontWeight: "bolder",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Premium");
                  }}
                >
                  Premium
                </button>
              </td>
            </tr>
            <tr>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                Monthly Price
              </td>
              <td style={{ padding: "2vw", textAlign: "center" }}>₱250</td>
              <td style={{ padding: "2vw", textAlign: "center" }}>₱530</td>
            </tr>
            <tr>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                Video Quality
              </td>
              <td style={{ padding: "2vw", textAlign: "center" }}>HD</td>
              <td style={{ padding: "2vw", textAlign: "center" }}>Ultra HD</td>
            </tr>
          </tbody>
        </table>

        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "2vw",
          }}
        >
          {userInfo && !userInfo.isSubscriber && (
            <PayPalScriptProvider
              options={{
                "client-id":
                  "AYnh-9IN7iqMYmDzQBEF7n5R1nPztWUTQHP_5a64noW3ZMeNfyppUPlIyTNi-sFqQYlBc3DX4lbGtI44", // papalitan din
                components: "buttons",
                intent: "subscription",
                vault: true,
              }}
            >
              <PayPalButton type="subscription" />
            </PayPalScriptProvider>
          )}
          <Link to="/login">
            <button
              style={{
                cursor: "pointer",
                border: "0.2vw solid rgba(0, 0, 0, 1)",
                backgroundColor: "rgba(0, 0, 0, 1)",
                borderRadius: "0.5vw",
                color: "#ffffff",
                padding: "1vw",
                fontSize: "1.8vw",
                fontWeight: "bolder",
              }}
            >
              Next
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Subscription;
